import React, { Component } from "react";
import { connect } from "react-redux";
import Moment from "react-moment";

class EducationProfile extends Component {
  render() {
    console.log(this.props);
    return (
      <div className="container my-3 ">
        <table className="table table-borderless">
          <tbody>
            <tr>
              <td className="text-muted">School</td>
              <td>{this.props.school}</td>
            </tr>
            <tr>
              <td className="text-muted">Degree</td>
              <td>{this.props.degree}</td>
            </tr>
            <tr>
              <td className="text-muted"> Study</td>
              <td>{this.props.fieldofstudy}</td>
            </tr>
            <tr>
              <td className="text-muted">Years</td>
              <td>
                <Moment format="YYYY/MM/DD">{this.props.from}</Moment> -{" "}
                <Moment format="YYYY/MM/DD">{this.props.to}</Moment>
              </td>
            </tr>
            <tr>
              <td className="text-muted">description</td>
              <td>{this.props.description}</td>
            </tr>
          </tbody>
        </table>
        <hr />
      </div>
    );
  }
}

const mapStateToProps = state => ({});

export default connect(mapStateToProps)(EducationProfile);
